// src/App.js
import React, { useState } from "react";
import PacketTable from "./PacketTable";
import {Modal, Button} from "react-"

function ResultBlock({ result }) {
  if (!result) return null;
  if (result.error) {
    return (
      <div className="alert alert-danger mt-3">
        <strong> Error: </strong> {result.error}
      </div>
    );
  }
  const packets = result.packets?? [];
  return (
    // <div style={{ marginTop: 16 }}>
    //   <h3>Parse Result (raw JSON)</h3>
    //   <div style={{
    //     background: "#0b1220",
    //     color: "#dff1c8",
    //     padding: 12,
    //     borderRadius: 6,
    //     maxHeight: "40vh",
    //     overflow: "auto",
    //     fontFamily: "monospace",
    //     fontSize: 13
    //   }}>
    //     <pre style={{ margin: 0, whiteSpace: "pre-wrap", wordBreak: "break-word" }}>
    //       {JSON.stringify(result, null, 2)}
    //     </pre>
    //   </div>
    // </div>
    <div className="mt-4">
      <h3 className="mb-3">
        Parse Result ({result.total_packets} packets)
      </h3>

      <div className="table-responsive">
        <table className="table table-striped table-hover table-bordered align-middle  text-center">
          <thead className="table-dark">
            <tr>
              <th>#</th>
              <th>Timestamp</th>
              <th>Source IP</th>
              <th>Dest IP</th>
              <th>Src Port</th>
              <th>Dst Port</th>
              <th>Protocol</th>
              <th>Description</th>
            </tr>
          </thead>
          <tbody>
            { packets.map(pkt => (
                <tr key={pkt.id}>
                  <td>{pkt.id}</td>
                  <td>{pkt.ts}</td>

                  <td>{pkt.src_ip}</td>
                  <td>{pkt.dst_ip}</td>

                  <td>{pkt.src_port}</td>
                  <td>{pkt.dst_port}</td>

                  <td>{pkt.protocol}</td>
                  <td>{pkt.description}</td>
                </tr>
            ))
          }
          </tbody>
        </table>
      </div>
    </div>
  );
}

function App() {
  const [file, setFile] = useState(null);
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const onFileChange = (e) => {
    setFile(e.target.files?.[0] ?? null);
    setResult(null);
  };

  const upload = async () => {
    if (!file) {
      alert("Please choose a file first");
      return;
    }
    setLoading(true);
    setResult(null);

    try {
      const form = new FormData();
      form.append("pcap", file);

      const res = await fetch("/api/parse", {
        method: "POST",
        body: form
      });

      if (!res.ok) {
        const txt = await res.text();
        throw new Error(`Server ${res.status}: ${txt}`);
      }

      const json = await res.json();
      setResult(json);
    } catch (err) {
      console.error(err);
      setResult({ error: String(err) });
    } finally {
      setLoading(false);
    }
  };

  // fetch detail function for PacketTable
  const fetchPacketDetail = async (id) => {
    const res = await fetch(`/api/packet_detail?id=${encodeURIComponent(id)}`);
    if (!res.ok) {
      const txt = await res.text();
      throw new Error(`Server ${res.status}: ${txt}`);
    }
    return res.json();
  };

  return (
    // <div style={{ maxWidth: 1100, margin: "24px auto", padding: 12, fontFamily: "Inter, Arial, sans-serif" }}>
    <div className="container my-4">
      <div className="card shadow p-4">
        <h1 className="mb-3">pcap â†’ GTP / PFCP Parser (frontend)</h1>

      <div className="mb-3">
        {/* <label style={{ display: "block", marginBottom: 8 }}> */}
          <input type="file" className="form-control" onChange={onFileChange} />
        {/* </label> */}
      </div>

        <div>
          <button
              className="btn btn-primary me-3" 
              onClick={upload}
              disabled={loading || !file} >

          {/* <button onClick={upload} disabled={loading || !file} style={{ padding: "6px 12px" }}> */}
            {loading ? "Parsing..." : "Upload & Parse"}
          </button>
          {/* <button
          onClick={() => { setFile(null); setResult(null); }}
          style={{ marginLeft: 8 }}> */}
          <button
              className="btn btn-secondary " 
              onClick={() => { setFile(null); setResult(null); }} >
            Reset
          </button>
        </div>

      {file && (
          <div className="alert alert-info mt-3">
            Selected <strong>{file.name}</strong> ({file.size} bytes)
          </div>
      )}

        <ResultBlock result={result} />
    </div>
    </div>
  );
}

export default App;
